import ReactDOM from 'react-dom';
import React,{ useEffect, useState } from "react";
import styles from './App.module.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import firstfloor from "./component/firstfloor";




function App() {
    const [openModal, setOpenModal] = useState(false);
    
    return (
        <body style={{backgroundImage: `url('/bg.png')`, height: '100%'}}>
          <nav>
            <div className={styles.containerFluid}>
              <a className={styles.navbarBrand}>
                <img src="/logo.png" alt="" width={500} />
              </a>
              <div className={styles.header}>
                <ul>
                  <li><a href="index.html">Home</a></li><a href="index.html">
                  </a><li><a href="index.html" /><a href="component/firstfloor.js">First Floor</a></li><a href="component/firstfloor.js">
                  </a><li><a href="firstfloor.html" /><a href="secondfloor.html">Second Floor</a></li><a href="secondfloor.html">
                  </a><li><a href="secondfloor.html" /><a href="thirdfloor.html">Third Floor</a></li><a href="thirdfloor.html">
                  </a><li><a href="thirdfloor.html" /><a href="fourthfloor.html">Fourth Floor</a></li><a href="fourthfloor.html">
                  </a></ul>
              </div>    
            </div>
          </nav>
          
        </body>
      );
}


export default App;
